function UpdateTableOccupyStatus(n){n!=null&&$.ajax({url:"/DiningTables/ReleaseOrOccupy",type:"POST",data:{Id:n,IsOccupied:$("#isInPercentSwitch:checked").prop("checked")},headers:{RequestVerificationToken:$('input:hidden[name="__RequestVerificationToken"]').val()},success:function(n){var t=n;console.log("response",t);t.responseCode==CODES.RESPONSE_CODE_OK?sweetAlert.success({title:"Success!",text:t.responseMessage}):t.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:t.errorMessage}):t.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:t.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while Releasing/Occupying Dining Table."})}})}